import React from 'react';
import {
  Grid,
  Paper,
  Typography,
  List,
  ListItem,
  ListItemText,
} from '@mui/material';
import { useTheme } from '@mui/material/styles';
import Box from '@mui/material/Box';
import MobileStepper from '@mui/material/MobileStepper';
import Button from '@mui/material/Button';
import KeyboardArrowLeft from '@mui/icons-material/KeyboardArrowLeft';
import KeyboardArrowRight from '@mui/icons-material/KeyboardArrowRight';
import SwipeableViews from 'react-swipeable-views';
import { autoPlay } from 'react-swipeable-views-utils';

import CustomImageAvatar from '../components/CustomImageAvatar';
import '../style/HomePage.css';
import avatar from '../images/avatar.png';

const AutoPlaySwipeableViews = autoPlay(SwipeableViews);

const images = [
  {
    label: 'San Francisco – Oakland Bay Bridge, United States',
    imgPath:
      'https://images.unsplash.com/photo-1537944434965-cf4679d1a598?auto=format&fit=crop&w=400&h=250&q=60',
  },
  {
    label: 'Bird',
    imgPath:
      'https://images.unsplash.com/photo-1538032746644-0212e812a9e7?auto=format&fit=crop&w=400&h=250&q=60',
  },
  {
    label: 'Bali, Indonesia',
    imgPath:
      'https://images.unsplash.com/photo-1537996194471-e657df975ab4?auto=format&fit=crop&w=400&h=250',
  },
  {
    label: 'Goč, Serbia',
    imgPath:
      'https://images.unsplash.com/photo-1512341689857-198e7e2f3ca8?auto=format&fit=crop&w=400&h=250&q=60',
  },
];

function HomePage() {
  return (
    <div className="HomePage">
      <header className="HomePage-header">
            <CustomImageAvatar size={220} imgPath={avatar}></CustomImageAvatar>
        <Grid container spacing={2}>
          {/* Left Side - Avatar and Phrase */}
          <Grid item xs={12} sm={7}>
            <Paper elevation={3} className="avatar-container">
              <Typography variant="h5" component="div" className="animated-text">
                Animated Text Below Avatar
              </Typography>
            </Paper>
          </Grid>

          {/* Right Side - Animated Vertical Menu */}
          <Grid item xs={12} sm={5}>
            <List component="nav" className="vertical-menu">
              <ListItem button>
                <ListItemText primary="Menu Item 1" />
              </ListItem>
              <ListItem button>
                <ListItemText primary="Menu Item 2" />
              </ListItem>
              <ListItem button>
                <ListItemText primary="Menu Item 3" />
              </ListItem>
              {/* Add more menu items as needed */}
            </List>
          </Grid>
        </Grid>
      </header>
    </div>
  );
}

export default HomePage;
